html, body {
    font-family: 'Nunito', sans-serif;
    margin: 0;
    padding: 0;
}

.container {
    padding-top: 100px;
    background: #3E92CC;
}

.jumbotron {
    width: 100%;
    height: 600px;
    padding: 0;
    margin: 0;
}

.separator {
    color: #FFFAFF;
    margin: 0;
    padding: 90px 0 90px 0;
    display: flex;
    justify-content: center;
    align-items: center;
}

.separator-content {
    background: rgba(0, 58, 99, 0.5);
    box-shadow: 4px 3px 4px rgba(30, 27, 24, 0.5);
    border-radius: 4px;
    text-align: center;
    display: flex;
    justify-content: center;
    align-items: center;
    max-width: 75%;
}

.text-title {
    font-size: 25px;
    padding: 30px;
    max-width: 75%;
    font-weight: bold;
    color: #FFFAFF;
}

.top-bar {
    background: #FFFAFF;
    position: fixed;
    align-items: flex-end;
    justify-content: center;
    display: flex;
    width: 100%;
}

.top-bar ul {
    list-style: none;
    display: flex;
    padding: 5px;
    padding-left: 25px;
    padding-bottom: 0;
    margin: 0;
}

.top-bar ul li {
    padding: 10px;
    font-size: 20px;
    font-weight: bold;
}

.top-bar ul li a {
    text-decoration: none;
    color: inherit;
}

.active {
    color: #FFFAFF;
    background: rgba(0, 58, 99, 0.8);
}

.logo {
    height: 100px;
}

.three-panel {
    width: 100%;
    background: #FFFAFF;
    display: flex;
    justify-content: space-between;
}

.panel3 {
    padding: 20px;
    width: 30%;
    display: flex;
    align-items: center;
    justify-content: center;
}

.panel3 ul {
    list-style: none;
    padding: 40px;
    border-radius: 5px;
}

.panel3 ul li {
    padding: 10px;
    font-size: 20px;
}

h3 {
    text-align: center;
    margin: 0;
    font-weight: bold;
    font-size: 25px;
}

.two-panel {
    display: flex;
}

.panel2 {
    width: 50%;
    background: #D8315B;
    display: flex;
    align-items: center;
    justify-content: center;
}

.panel2 img {
    width: 100%;
    height: 100%;
}

.panel2 ul {
    list-style: none;
    padding: 30px;
}

.panel2 ul li {
    padding: 10px;
    font-size: 30px;
    color: #FFFAFF;
}

.panel2 ul li a {
    text-decoration: none;
    color: rgba(255, 250, 255, 0.7)
}

.panel2 ul li a:hover {
    color: rgba(255, 250, 255, 1)
}

.contact-form {
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 70px;
    font-size: 20px;
    color: #FFFAFF;
}

.form-content form {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
}

.form-section {
    padding: 10px;
    display: flex;
    flex-direction: column;
}

.form-section input {
    border: none;
    width: 300px;
    height: 20px;
    font-size: 20px;
    padding: 5px;
}

.form-section textarea {
    border: none;
    width: 300px;
    font-size: 20px;
    padding: 5px;
}

#submit-button {
    border-radius: 3px;
    background: #003A63;
    border: none;
    color: #FFFAFF;
    padding: 5px 10px;
    margin-top: 10px;
    width: 80px;
    height: 35px;
    font-size: 16px;
}

#phone-number {
    color: #D8315B;
    font-size: 25px;
    margin: 0;
    padding-left: 70px;
    padding-bottom: 10px;
}

footer {
    background: #1E1B18;
    color: #FFFAFF;
    font-size: 14px;
    height: 50px;
    display: flex;
    padding-left: 20px;
    align-items: center;
}
